var Ac4yFlowConstant=require("../constant/Ac4yFlowConstant.js");
var Ac4yLifecycleConstant=require("@ac4y/ac4y-lifecycle/constant/Ac4yLifecycleConstant.js");

var Ac4yLCDStock=require("@ac4y/ac4y-lifecycle/domain/Ac4yLCDStock.js");
var Ac4yLCDStage=require("@ac4y/ac4y-lifecycle/domain/Ac4yLCDStage.js");
var Ac4yLCDStation=require("@ac4y/ac4y-lifecycle/domain/Ac4yLCDStation.js");

var Ac4yFLCDState=require("./Ac4yFLCDState.js");
var Ac4yFLCDStep=require("./Ac4yFLCDStep.js");

class Ac4yFLCDStock extends Ac4yLCDStock {
    
    constructor(object) {

        super(object);
        if (object != undefined && object === 0) return;

        this.put(new Ac4yLifecycleConstant().DIMENSION.state, new Ac4yFLCDState());
        this.put(new Ac4yLifecycleConstant().DIMENSION.step, new Ac4yFLCDStep());
        this.put(new Ac4yLifecycleConstant().DIMENSION.stage, new Ac4yLCDStage());
        this.put(new Ac4yLifecycleConstant().DIMENSION.station, new Ac4yLCDStation());

    } // constructor
    
    createSelf(object) {return new Ac4yFLCDStock(object);}

} // Ac4yFLCDStock

module.exports=Ac4yFLCDStock
